import React, { Component } from "react";
import "./Previewframe.css";

class Previewframe extends Component {
  render() {
    const images = this.props.images;
    const length = images.length;
    const img = images[0];
    console.log(length);
    const width = length !== 0 ? images[0].width : 0;

    console.log(width);

    return (
      <>
        {images.length !== 0 ? (
          <div
            className="container"
            style={{
              width: `${width}px`,
            }}
          >
            {images.length !== 0 ? (
              <img src={images[0].src.large} alt="lol" />
            ) : null}
          </div>
        ) : null}
      </>
    );
  }
}

export default Previewframe;
